//Default
import { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import "./style.css";
//Database
import { auth, firebase } from "../../firebase";
import { ref, child, set } from "firebase/database";
import {
  createUserWithEmailAndPassword,
  signInWithEmailAndPassword,
  onAuthStateChanged,
} from "firebase/auth";

//FrameWork
import { EyeSlashFilledIcon } from "../../Framework/EyeSlashFilledIcon";
import { EyeFilledIcon } from "../../Framework/EyeFilledIcon";
import { UserIcon, CameraIcon, HeartIcon } from "../../Framework/Button_login";
import { Button } from "@nextui-org/react";
import { Input } from "@nextui-org/react";

function Login() {
  //Khai báo dùng navigate để link to
  const navigate = useNavigate();

  //Khai báo State Login Sai --> Login lại + show warning
  const [failLogin, setFailLogin] = useState(false);

  //Khai báo hàm add data của User vào Realtime Firebase
  function addDataUserFirebase(userCredential) {
    const dbRef = ref(firebase);
    set(child(dbRef, `users/${userCredential.user.uid}`), {
      email: `${username}@gmail.com`,
      username: `${username}`,
      img: `data:image/jpeg;base64,`,
      uid: `${userCredential.user.uid}`,
      password: `${password}`,
    });
  }

  //Check user đã login chưa // Chưa --> Login // Rồi --> HomePage
  useEffect(() => {
    onAuthStateChanged(auth, (user) => {
      if (user) {
        // Người dùng đã đăng nhập
        console.log("Người dùng đã đăng nhập:", user.uid);
        navigate("/");
      } else {
        // Người dùng chưa đăng nhập
        console.log("Người dùng chưa đăng nhập");
        navigate("/login");
      }
    });
  }, []);

  //Khai báo button LogIn Account Firebase
  const handleLogIn = () => {
    // Đăng nhập người dùng
    const loginEmail = `${username}@email.com`;
    const loginPassword = `${password}`;
    signInWithEmailAndPassword(auth, loginEmail, loginPassword)
      .then((userCredential) => {
        // Đăng nhập thành công, bạn có thể truy cập thông tin userCredential.user
        const user = userCredential.user;
        console.log("Đăng nhập thành công:", user.uid);
        alert("Đăng nhập thành công:", user.uid);
        navigate("/");
      })
      .catch((error) => {
        // Xử lý lỗi ở đây
        setFailLogin(true);
        console.log("Lỗi đăng nhập:", error.message);
        alert(`Lỗi đăng nhập:${error.message}`);
      });
  };

  //Khai báo button Register Account Firebase
  const handleSignIn = () => {
    // Đăng ký người dùng mới
    const resgisteEmail = `${username}@email.com`;
    const registerPassword = `${password}`;
    createUserWithEmailAndPassword(auth, resgisteEmail, registerPassword)
      .then((userCredential) => {
        // Đăng ký thành công, bạn có thể truy cập thông tin userCredential.user
        const user = userCredential.user;
        addDataUserFirebase(userCredential);
        console.log("Đăng ký thành công:", user.uid);
        alert("Đăng ký thành công");
      })
      .catch((error) => {
        // Xử lý lỗi ở đây
        console.log("Lỗi đăng ký:", error.message);
        alert(`Lỗi đăng ký:${error.message}`);
      });
  };

  //Khai báo icon + function show password
  const [isVisible, setIsVisible] = useState(false);
  const toggleVisibility = () => setIsVisible(!isVisible);

  //Khai báo value input
  let username = "";
  let password = "";

  return (
    <>
      <div className="login">
        <div className="login_header">
          <h2>Đăng nhập</h2>
        </div>
        <div className="login_input">
          <div className="flex w-full flex-wrap md:flex-nowrap gap-4">
            <Input
              type="text"
              label="Username"
              onChange={(e) => {
                username = e.target.value;
              }}
            />
          </div>
        </div>
        <div className="login_input">
          <div className="flex w-full flex-wrap md:flex-nowrap gap-4">
            <form>
              <Input
                label="Password"
                onChange={(e) => {
                  password = e.target.value;
                }}
                autoComplete="on"
                endContent={
                  <button
                    className="focus:outline-none"
                    type="button"
                    onClick={toggleVisibility}
                  >
                    {isVisible ? (
                      <EyeSlashFilledIcon className="text-2xl text-default-400 pointer-events-none" />
                    ) : (
                      <EyeFilledIcon className="text-2xl text-default-400 pointer-events-none" />
                    )}
                  </button>
                }
                type={isVisible ? "text" : "password"}
                className="max-w-xs"
              />
            </form>
          </div>
        </div>
        {failLogin ? (
          <>
            <div id="user_login_fail">Wrong username or password</div>
          </>
        ) : (
          <></>
        )}
        <div className="login_button">
          <div className="flex gap-4 items-center">
            <Button
              onClick={handleLogIn}
              color="success"
              variant="bordered"
              startContent={<UserIcon />}
            >
              <p>Sign in</p>
            </Button>
            <Button
              onClick={handleSignIn}
              color="primary"
              variant="bordered"
              startContent={<HeartIcon />}
            >
              <p>Sign up</p>
            </Button>
          </div>
          <div id="btn_try" className="flex gap-4 items-center justify-center">
            <Button
              onClick={() => navigate("/")}
              color="warning"
              variant="bordered"
              startContent={<CameraIcon />}
            >
              <p>Try me free</p>
            </Button>
          </div>
        </div>
      </div>
    </>
  );
}

export default Login;
